/*Table structure for table `camera` */

DROP TABLE IF EXISTS `camera`;

CREATE TABLE `camera` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `CameraCode` varchar(10) DEFAULT NULL COMMENT '厂内统一编号',
  `CameraName` varchar(50) DEFAULT NULL COMMENT '摄像头名称',
  `CameraIp` varchar(50) DEFAULT NULL COMMENT 'ip',
  `CameraPort` varchar(10) DEFAULT NULL COMMENT '端口',
  `LoginName` varchar(10) DEFAULT NULL COMMENT '登录名称',
  `LoginPwd` varchar(10) DEFAULT NULL COMMENT '登录密码',
  `Token` varchar(50) DEFAULT NULL COMMENT '视频流的通道名称',
  `Type` int(2) DEFAULT NULL COMMENT '摄像头类型（1=大华，2=海康）',
  `Rtsp` varchar(200) DEFAULT NULL COMMENT 'rtsp地址',
  `Area` varchar(50) DEFAULT NULL COMMENT '区域（如变频间）',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='摄像头参数表';

