/*Table structure for table `kcrobotlog` */

DROP TABLE IF EXISTS `kcrobotlog`;

CREATE TABLE `kcrobotlog` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Num` int(11) DEFAULT NULL COMMENT '巡检号，相同则为同一次巡检',
  `Dt` datetime DEFAULT NULL COMMENT '巡检时间',
  `CheckType` varchar(10) DEFAULT NULL COMMENT '检测类型，如甲烷遥测/声音检测/图像识别/温度检测',
  `DeviceName` varchar(50) DEFAULT NULL COMMENT '设备名称，即点位名称',
  `CheckResult` varchar(10) DEFAULT NULL COMMENT '识别结果，结果值',
  `CheckStatus` varchar(10) DEFAULT NULL COMMENT '识别成功或识别失败',
  `Area` varchar(10) DEFAULT NULL COMMENT '区域',
  `LimitMin` varchar(10) DEFAULT NULL COMMENT '报警下限',
  `LimitMax` varchar(10) DEFAULT NULL COMMENT '报警上限',
  `IsAlert` int(10) DEFAULT NULL COMMENT '报警',
  `ImgUrl` varchar(200) DEFAULT NULL COMMENT '图片或视频',
  `Remark` varchar(2000) DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=2668 DEFAULT CHARSET=utf8 COMMENT='防爆工艺机器人巡检记录';

