  `Id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `PointNumber` varchar(50) DEFAULT NULL COMMENT '导航点名称',
  `PointName` varchar(50) DEFAULT NULL COMMENT '点位名称',
  `A_Axis3D` varchar(50) DEFAULT NULL COMMENT '起点坐标',
  `B_Axis3D` varchar(50) DEFAULT NULL COMMENT '终点坐标',
  `Area` varchar(50) DEFAULT NULL COMMENT '区域',
  `Type` int(10) DEFAULT NULL COMMENT '点位类型：1甲烷遥测2高温检测3声音检测4图像识别5开关门.6语音播报',
  `GUID` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=1459 DEFAULT CHARSET=utf8;

