/*Table structure for table `methane` */

DROP TABLE IF EXISTS `methane`;

CREATE TABLE `methane` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `MethaneName` varchar(50) DEFAULT NULL COMMENT '设备名称',
  `MethaneIp` varchar(50) DEFAULT NULL COMMENT '甲烷ip',
  `MethanePort` varchar(50) DEFAULT NULL COMMENT '甲烷端口',
  `MethaneUser` varchar(50) DEFAULT NULL COMMENT '甲烷用户',
  `MethanePwd` varchar(50) DEFAULT NULL COMMENT '甲烷密码',
  `CameraIp` varchar(50) DEFAULT NULL COMMENT '可见光ip',
  `CameraPort` varchar(50) DEFAULT NULL COMMENT '可见光端口',
  `CameraUser` varchar(50) DEFAULT NULL COMMENT '可见光用户',
  `CameraPwd` varchar(50) DEFAULT NULL COMMENT '可见光密码',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='激光甲烷设备列表';

