/*Table structure for table `methanelog` */

DROP TABLE IF EXISTS `methanelog`;

CREATE TABLE `methanelog` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `MethaneName` varchar(20) DEFAULT NULL COMMENT '设备名称',
  `MethanePoint` varchar(10) DEFAULT NULL COMMENT '巡检点位',
  `Val` varchar(10) DEFAULT NULL COMMENT '巡检值',
  `IsAlert` int(5) DEFAULT NULL COMMENT '1.正常2.报警',
  `LimitMax` varchar(10) DEFAULT NULL COMMENT '阈值',
  `Dt` datetime DEFAULT NULL COMMENT '巡检时间',
  `StartTime` datetime DEFAULT NULL COMMENT '本次开始时间（用来标识一台设备一次巡检）',
  `ImgUrl` varchar(100) DEFAULT NULL COMMENT '图片',
  `Num` int(11) DEFAULT NULL COMMENT '巡检批次号',
  `Cause` varchar(50) DEFAULT NULL COMMENT '报警原因',
  `Remark` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`Id`)
