/*Table structure for table `points` */

DROP TABLE IF EXISTS `points`;

CREATE TABLE `points` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Point` varchar(50) DEFAULT NULL COMMENT '点位',
  `Parameter` varchar(50) DEFAULT NULL COMMENT '点位描述',
  `Address` varchar(10) DEFAULT NULL COMMENT 'pks地址',
  `Unit` varchar(20) DEFAULT NULL COMMENT '单位',
  `Type` int(5) DEFAULT NULL COMMENT '任务类型（指针表计读数/）1表盘读值2阀门开关',
  `LimitMax` varchar(20) DEFAULT NULL COMMENT '最大限值（为空时不限值，大于等于时报警）',
  `LimitMin` varchar(20) DEFAULT NULL COMMENT '最小限值（为空时不限制，小于等于时报警）',
  `Ranges` varchar(20) DEFAULT NULL COMMENT '量程（可不填）',
  `Axis3D` varchar(50) DEFAULT NULL COMMENT '3维坐标(x,y,z)',
  `IsPolling` int(1) DEFAULT NULL COMMENT '是否巡检',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=82 DEFAULT CHARSET=utf8 COMMENT='巡检点位表';

