/*Table structure for table `polling` */

DROP TABLE IF EXISTS `polling`;

CREATE TABLE `polling` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '巡检id',
  `Point` varchar(50) DEFAULT NULL COMMENT '点位名称',
  `StartTime` datetime DEFAULT NULL COMMENT '触发时间',
  `Ai` varchar(50) DEFAULT NULL COMMENT 'Ai识别值',
  `Pks` varchar(50) DEFAULT NULL COMMENT '远传值',
  `Differ` varchar(50) DEFAULT NULL COMMENT '差值',
  `Picture` varchar(500) DEFAULT NULL COMMENT '图片',
  `Conclusion` varchar(50) DEFAULT NULL COMMENT '结论',
  `AlarmType` varchar(50) DEFAULT NULL COMMENT '报警类型',
  `State` varchar(50) DEFAULT NULL COMMENT '报警状态',
  `RelieveTime` datetime DEFAULT NULL COMMENT '解除时间',
  `Cause` varchar(50) DEFAULT NULL COMMENT '报警原因',
  `Num` int(10) DEFAULT NULL COMMENT '巡检次数',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='巡检记录表';

