/*Table structure for table `pollingnum` */

DROP TABLE IF EXISTS `pollingnum`;

CREATE TABLE `pollingnum` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Num` int(11) DEFAULT NULL COMMENT '巡检次数',
  `IsPolling` int(1) DEFAULT NULL COMMENT '1是0否',
  `DeviceType` varchar(10) DEFAULT NULL COMMENT '设备类型',
  `DeviceNo` varchar(10) DEFAULT NULL COMMENT '设备号',
  `StartTime` datetime DEFAULT NULL COMMENT '巡检时间',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='巡检计数表';

