/*Table structure for table `pollingset` */

DROP TABLE IF EXISTS `pollingset`;

CREATE TABLE `pollingset` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `StartTime` varchar(50) DEFAULT NULL COMMENT '开始时间',
  `Remark` varchar(50) DEFAULT NULL COMMENT '备注',
  `DeviceType` varchar(10) DEFAULT NULL COMMENT '设备类型',
  `DeviceNo` varchar(10) DEFAULT NULL COMMENT '设备编号',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='自动巡检设置';

