/*Table structure for table `powerrobot` */

DROP TABLE IF EXISTS `powerrobot`;

CREATE TABLE `powerrobot` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `RobotType` int(11) DEFAULT NULL COMMENT '机器人类型，1是吊轨，2是轮式',
  `Num` int(11) DEFAULT NULL COMMENT '巡检号，相同则是同一次巡检',
  `Dt` datetime DEFAULT NULL COMMENT '巡检时间',
  `DeviceName` varchar(20) DEFAULT NULL COMMENT '设备名称，即机柜名称',
  `CheckItem` varchar(50) DEFAULT NULL COMMENT '检测项',
  `CheckResult` varchar(50) DEFAULT NULL COMMENT '检测结果',
  `ImgUrl` varchar(200) DEFAULT NULL COMMENT '关联图片，可为空',
  `IsAlert` int(4) DEFAULT NULL COMMENT '状态',
  `Remark` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=9934 DEFAULT CHARSET=utf8 COMMENT='电力机器人巡检记录';

