/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `UserCode` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户编码',
  `UserName` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户名称',
  `PassWord` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '密码',
  `RoleCode` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户角色',
  `RoleId` int(11) DEFAULT NULL COMMENT '权限编号',
  `Remark` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='用户表';

